import {Switch, Router } from "react-router-dom";


import React from 'react';


import { Route } from "react-router-dom";
import Launch from "./Launch";



function Controller() {
    return<><Router>
    <Switch>
        <Route exact path="/" component={Launch}></Route>
    </Switch>
   </Router>

   </>
}

export default Controller;
